@-moz-document regexp("^https?://(www.|images.|encrypted.)*google\\.(com|.{2}|.{2,3}\\..{2})(/|\\?|$).*") {
  /*
  Restyling of Google's start page

  Source code:
  http://userstyles.org/styles/93926/silver-google
  https://github.com/sbriskin/userstyles.org
  */
    body.hp {
        background:#F7F7F7 url("data:image/jpeg;base64,") 0 0 no-repeat !important;
        background-size: cover !important;
    }
    #lga * {
        display: none;
    }
    #lga {
        /*Dark logo:*/
        background: url("data:image/png;base64,") 50% 35% no-repeat !important;
        background-size: auto 50% !important;
        opacity: .8 !important;
    }
    #cnt {
        background: #FFF !important;
    }
    .mw {
        background: #FFF !important;
    }
    #gbqfqw {
        border: 1px solid #CCC !important;
    }
    #gbqfqw .gsfe_a {
        border: 1px solid #333 !important;
    }
    .fbar {
        background: transparent !important;
        border-top: 0 !important;
    }
    .vk_c, .vk_cxp, #rhs .vk_rhsc {
        background: #FAFAFA !important;
    }
    .kno-sh {
        background: transparent !important;
    }
    #pmocntr2 {
        display: none !important;
    }
}
